contract HomeWork1 {

	struct ECPoint {
	uint256 x;
	uint256 y;
}


function rationalAdd(ECPoint calldata A, ECPoint calldata B, uint256 num, uint256 den) public view returns (bool verified) {

	// return true if the prover knows two numbers that add up to num/den
}

string public helloStr = "hello world";
uint [] public nums = [10,20,30];

function getHello() public view returns (string memory) {
    return  helloStr;
}

function pushNewElement(uint newElement) public returns (uint) {
    nums.push(newElement);
}

function popLastELement() public returns (uint x) {
    nums.pop();
}

function setHello(string memory newHello) public {
    helloStr = newHello;
}


}

